import React, { useState, useEffect } from 'react';
import './content.css';

// React-tabs Module
import { Tab, Tabs, TabList, TabPanel } from 'react-tabs';
import 'react-tabs/style/react-tabs.css';


//import { BarChart, CartesianGrid, XAxis, YAxis, Tooltip, Bar, Cell } from 'recharts';

function Databox() {

  let [Email, setEmail] = useState('eerokos');
  let [data, setData] = useState([]);
  let table = [];

  useEffect(() => {
    getData();
  });

  async function getData() {
    fetch('http://localhost:3000/' + Email)
      .then(response => response.json())
      .catch(error => console.error('Error:', error))
      .then(response => { setData(JSON.stringify(response)) })
  }

  function fillTable() {
    /*return data.map((c,n) => {
      <tr key={c.id}>
        <td key={c.totalHours}></td>
      </tr>
    });*/
  }

  return (
    <Tabs className="box">
      <TabList>
        <Tab>Array</Tab>
        <Tab>Graph</Tab>
      </TabList>

      <TabPanel>

        <table>
          <tbody>
            {fillTable()}
          </tbody>
        </table>
      </TabPanel>
      <TabPanel>
        <h2>Graph</h2>
      </TabPanel>
    </Tabs>
  );
}

export default Databox;
